import React from 'react';


function Contact() {
  return (
    <div className="contact">
      <h2>Contact Us</h2>
      <p>
        We'd love to hear from you! Please feel free to contact us with any questions or inquiries.
      </p>

      <div className="contact-info">
        <p>
          <strong>Email:</strong> <a href="mailto:support@yourcompany.com">support@yourcompany.com</a>
        </p>
        <p>
          <strong>Phone:</strong> +1 555 123 4567
        </p>
        <p>
          <strong>Address:</strong> 123 Main St, Anytown, USA
        </p>

        <p style={{ textAlign: "center" }}>Follow us on social media:</p>
        <div className="social-media-icons">
          <a href="https://www.facebook.com/your-facebook-page" target="_blank" rel="noopener noreferrer">
            <img src="data:image/jpeg;base64," alt="Facebook" />
          </a>
          <a href="https://twitter.com/your-twitter-handle" target="_blank" rel="noopener noreferrer">
            <img src="data:image/png;base64," />
          </a>
          <a href="https://www.instagram.com/your-instagram-handle" target="_blank" rel="noopener noreferrer">
            <img src="data:image/jpeg;base64," alt="Instagram" />
          </a>
        </div>
      </div>
    </div>
  );
}

export default Contact;